def carFleet(target, position, speed):
    # Pair positions with speeds and sort by position (closest to target first)
    cars = sorted(zip(position, speed), reverse=True)

    stack = []

    for pos, spd in cars:
        # Calculate time to reach target
        time = (target - pos) / spd

        # If this car takes longer or equal time than the previous car,
        # they will form a fleet (or this car will join the previous fleet)
        if not stack or time > stack[-1]:
            stack.append(time)

    return len(stack)

